(517, 191, 'braican_project_text', 'EDF + Business is the Corporate Partnerships side of the Environmental Defense Fund. Partnering with leading national companies, they collaborate to promote innovative business practices that focus on sustainability. I was approached to build a responsive, modern site that more accurately conveys this message and the overall brand of the Environmental Defense Fund. We decided on WordPress to easily create and administer content, which includes a fairly active blog and a number of resources and case studies.'),
