(576, 206, 'braican_project_text', 'I was contracted to help Brooklyn Boulders, a national rock gym and creative community, recreate their online presence and do a full overhaul of their website. Using WordPress, I developed a completely custom theme for the company that showcases their diverse ideals and empowers their collective community. The company currently operates gyms out of three locations, so we used WordPress multisite to create three separate (but connected) sites, and leveraged WordPress\' blogging capabilities to drive their dynamic content.'),
