(664, 244, 'braican_project_text', 'I got together with JoyJ, a non-profit group that helps to provide provisions and necessitates to local homeless populations, to rebuild their website. We chose to use WordPress to provide a simple yet robust platform through which the group can spread their message through complete content control. The non-profit keeps a blog which they post to with relative frequency, and the site was designed as an informative one-page site to keep their information focused and clear.'),
