(801, 8, 'braican_intro_copy', 'Hey, you make cool stuff.'),
(802, 8, '_braican_intro_copy', 'field_5a45b4e6c58d5'),
(803, 8, 'braican_main_copy', 'As it turns out, I can help you with that.\r\n\r\nI\'m Nick, and I\'ve worked for the past 8 years building and designing for the web. In that time, I\'ve partnered with some really great people to help build their brands and highlight their cool stuff.\r\n\r\nYou might also be interested to know that I make my own beer, though I\'m still working on the quality control thing. But hey, let me know if you <a href="http://breakbrewing.com/" target="_blank" rel="noopener">want some</a>.\r\n\r\nI\'m currently a senior engineer at <a href="https://www.upstatement.com/" target="_blank" rel="noopener">Upstatement</a> in Boston where I\'ve worked with some of those aforementioned people to increase their impact.\r\n\r\nI also partner with my own clients on a freelance basis. So <a href="#colophon">get in touch</a>, and let\'s see where we can take your ideas.'),
(804, 8, '_braican_main_copy', 'field_5a45b50ac58d7'),
(805, 8, 'braican_lifestyle_image', '313'),
(806, 8, '_braican_lifestyle_image', 'field_5a45b4f4c58d6'),
(807, 306, 'braican_intro_copy', 'Hey, you make cool stuff.'),
(808, 306, '_braican_intro_copy', 'field_5a45b4e6c58d5'),
(809, 306, 'braican_main_copy', 'So maybe you should know that I\'ve got 7+ years building and designing for the web and have helped some really great people build some really cool stuff.\r\n\r\nMaybe you should also know that I\'m terrible at making beer, but that doesn\'t stop me from trying. Seriously, let me know if you <a href="http://breakbrewing.com/" target="_blank" rel="noopener">want some</a>.\r\n\r\nI\'m currently a senior developer at Tank Design where I\'ve built some of those aforementioned cool things for the similarly aforementioned cool clients. I also take on my own clients.\r\n\r\nSo get in touch, and let\'s see where we can take your ideas.'),
