(849, 315, '_form', '<p>Ready to start your next great project? I\'ve started an message for you below. Just add your name and email and maybe some info on what you\'re looking to do, and I\'ll get in touch as soon as I can.</p>\n\n<div class="content__main footer__contact">\n<p>Hey Nick, <br>My name is [text* sender_name akismet:author class:contact__input placeholder "Xander Bogaerts"] and you can reach me at [email* sender_email akismet:author_email class:contact__input placeholder "xman@gmail.com"]. I\'m looking for somebody to help me out&nbsp;with:</p>\n[textarea sender_main class:contact__textarea rows:3 placeholder "I want to build the next Bitcoin. It\'s called Yamcoin, and we need a website."]\n<p><button type="submit" class="a-btn">Let\'s go</button></p>\n</div>'),
