(894, 326, 'braican_main_copy', 'So maybe you should know that I\'ve spent the last 7 years building and designing for the web and have helped some really great people build some really cool stuff.\r\n\r\nMaybe you should also know that I\'m terrible at making beer, but that doesn\'t stop me from trying. Seriously, let me know if you <a href="http://breakbrewing.com/" target="_blank" rel="noopener">want some</a>.\r\n\r\nI\'m currently a senior developer at Tank Design where I\'ve built some of those aforementioned cool things for the similarly aforementioned groups. I\'m also taking on new clients on a freelance basis.\r\n\r\nSo get in touch, and let\'s see where we can take your ideas.'),
