(4752, 727, '_field_sender_main', 'Hi Nick.  For. few years I have been pointing my students to read your great write up on Futura and Renner (https://braicantype2.files.wordpress.com/2011/08/8-7-layout2.pdf).  I wonder if you would give me permission to PDF it and put it in my course reader, fully credited to you etc.  Please let me know.  \r\n\r\nCheers, Azhar.\r\n\r\nAzhar Mohamed\r\nPrincipal Academic and Design Consultant\r\nNMIT Nelson Marlborough Institute of Technology, New Zealand.\r\nOffice (03) 539-1820\r\nMobile (021) 352-870'),
