(6609, 914, 'braican_intro_copy', 'Hey, you make cool stuff.'),
(6610, 914, '_braican_intro_copy', 'field_5a45b4e6c58d5'),
(6611, 914, 'braican_main_copy', 'So maybe you should know that I\'ve spent the last 7 years building and designing for the web and have worked with some really great people to build some really cool stuff.\r\n\r\nMaybe you should also know that I\'m terrible at making beer, but that doesn\'t stop me from trying. Seriously, let me know if you <a href="http://breakbrewing.com/" target="_blank" rel="noopener">want some</a>.\r\n\r\nI\'m currently a senior engineer at Upstatement where I\'ve helped some of those aforementioned great people build that cool stuff. I also take on work from my own clients on a freelance basis.\r\n\r\nSo <a href="#colophon">get in touch</a>, and let\'s see where we can take your ideas.'),
