(7447, 999, '_akismet', 'a:2:{s:7:"comment";a:44:{s:14:"comment_author";s:10:"Jack White";s:20:"comment_author_email";s:22:"jack.white@comcast.net";s:18:"comment_author_url";s:0:"";s:15:"comment_content";s:1114:"Hi Nick.\r\n \r\nMy name is Jack White (not the one you may be thinking of).  I\'m the proprietor of a small Boston area web design company named A Streetcar Named Design.\r\n \r\nI\'m about to start work for a new restaurant/pub website for an existing client.  A functionality requirement is that menus, cocktail and wine lists be editable and updated by the client in their own offices, which hasn’t been the case up to now.  The rest of the site does not.  In the past, I\'ve created complete, responsive websites by writing my own HTML5, CSS3 and media queries, then passed that site off to a WordPress developer to convert it to WP and do whatever work is necessary with the web hosting company, and provide a short tutorial by phone to the client in the use of the dashboard.  \r\n \r\nThe Racial Wealth Audit website is an example of this.  http://racialwealthaudit.org  \r\n \r\nSo, my question is, is this the kind of project -- taking another person\'s design and \'Wordpress-ing\' it -- you\'d be interested in?\r\n \r\nThanks ... I\'ll look forward to hearing back from you.\r\n \r\nJack White\r\nhttp://www.astreetcarnameddesign.com";s:4:"blog";s:28:"http://braican-api.ups.dock/";s:9:"blog_lang";s:5:"en_US";s:12:"blog_charset";s:5:"UTF-8";s:7:"user_ip";s:12:"75.150.76.50";s:10:"user_agent";s:77:"Mozilla/5.0 (Windows NT 6.1; Win64; x64; rv:59.0) Gecko/20100101 Firefox/59.0";s:8:"referrer";s:29:"http://braican-api.ups.dock//";s:12:"comment_type";s:12:"contact-form";s:15:"SERVER_SOFTWARE";s:22:"Apache/2.4.25 (Ubuntu)";s:11:"REQUEST_URI";s:1:"/";s:9:"HTTP_HOST";s:11:"braican.com";s:15:"HTTP_USER_AGENT";s:77:"Mozilla/5.0 (Windows NT 6.1; Win64; x64; rv:59.0) Gecko/20100101 Firefox/59.0";s:11:"HTTP_ACCEPT";s:63:"text/html,application/xhtml+xml,application/xml;q=0.9,*/