(7883, 1045, 'braican_main_copy', 'As it turns out, I can help you with that.\r\n\r\nI\'ve worked for the past 8 years building and designing for the web and have worked with some really great people to help build and enhance their cool stuff.\r\n\r\nYou might also be interested to know that I make my own beer, though I\'m still working on the quality control thing. But hey, let me know if you <a href="http://breakbrewing.com/" target="_blank" rel="noopener">want some</a>.\r\n\r\nI\'m currently a senior engineer at Upstatement where I\'m able to work with some amazing teams on their innovative and positive brands. I also take on work from my own clients on a freelance basis.\r\n\r\nSo <a href="#colophon">get in touch</a>, and let\'s see where we can take your ideas.'),
