(7889, 1046, 'braican_main_copy', 'As it turns out, I can help you with that.\r\n\r\nI\'m Nick, and I\'ve worked for the past 8 years building and designing for the web. In that time, I\'ve partnered with some really great people to help build their brands and highlight their cool stuff.\r\n\r\nYou might also be interested to know that I make my own beer, though I\'m still working on the quality control thing. But hey, let me know if you <a href="http://breakbrewing.com/" target="_blank" rel="noopener">want some</a>.\r\n\r\nI\'m currently a senior engineer at <a href="https://www.upstatement.com/" target="_blank" rel="noopener">Upstatement</a> in Boston where I\'ve worked with some of those aforementioned people to increase their impact.\r\n\r\nI also partner with my own clients on a freelance basis. So <a href="#colophon">get in touch</a>, and let\'s see where we can take your ideas.'),
