(191, 2, '2014-06-24 15:29:12', '2014-06-24 15:29:12', 'EDF + Business is the Corporate Partnerships side of the Environmental Defense Fund. Partnering with leading national companies, they collaborate to promote innovative business practices that focus on sustainability. I was approached to build a responsive, modern site that more accurately conveys this message and the overall brand of the Environmental Defense Fund. We decided on WordPress to easily create and administer content which includes a fairly active blog and a number of resources and case studies.', 'EDF + Business', '', 'publish', 'closed', 'closed', '', 'edf-business', '', '', '2018-01-06 00:25:14', '2018-01-06 00:25:14', '', 0, 'http://braican-api.ups.dock//?post_type=project&#038;p=191', 7, 'project', '', 0),
