(201, 2, '2014-12-23 15:26:06', '2014-12-23 15:26:06', 'After picking up a homebrewing starter kit and brewing a batch of beer, I thought it would be cool to keep track of my progress and keep my design chops up with creative labels for the beers I make. I\'ve always got a few extra bottles laying around; just sayin\'.', 'Break Brewing Project', '', 'publish', 'closed', 'closed', '', 'break-brewing-project', '', '', '2018-01-06 00:22:36', '2018-01-06 00:22:36', '', 0, 'http://braican-api.ups.dock//?post_type=project&#038;p=201', 6, 'project', '', 0),
(206, 2, '2014-12-23 16:10:04', '2014-12-23 16:10:04', 'I got the opportunity to work with Brooklyn Boulders, a national rock gym and creative community, to recreate their online presence and complete a full overhaul of their website. Using WordPress, I developed a custom theme for the company that showcases their diverse ideals and empowers their collective community. Upon launch the gym operated out of three locations, so we used WordPress multisite to create three separate (but connected) sites and leveraged WordPress\' blogging capabilities to drive their dynamic content.', 'Brooklyn Boulders', '', 'publish', 'closed', 'closed', '', 'brooklyn-boulders', '', '', '2018-01-06 00:00:04', '2018-01-06 00:00:04', '', 0, 'http://braican-api.ups.dock//?post_type=project&#038;p=206', 5, 'project', '', 0),
(215, 2, '2018-01-03 04:31:58', '2018-01-03 04:31:58', 'I was contracted to help Brooklyn Boulders, a national rock gym and creative community, recreate their online presence and complete a full overhaul of their website. Using WordPress, I developed a custom theme for the company that showcases their diverse ideals and empowers their collective community. Upon launch the gym operated out of three locations, so WordPress multisite to create three separate (but connected) sites, and leveraged WordPress\' blogging capabilities to drive their dynamic content.', 'Brooklyn Boulders', '', 'inherit', 'open', 'open', '', '206-autosave-v1', '', '', '2018-01-03 04:31:58', '2018-01-03 04:31:58', '', 206, 'http://braican-api.ups.dock//206-autosave-v1/', 0, 'revision', '', 0),
