(244, 2, '2016-02-04 17:27:53', '2016-02-04 17:27:53', 'I worked with JoyJ, a non-profit that helps to provide provisions and necessities to local homeless populations, to rebuild their website. We chose WordPress to provide a simple yet robust platform through which the group can spread their message through complete content control. The non-profit maintains a fairly active blog, and the site was designed as an informative one-page site to keep their information focused and clear.', 'JoyJ', '', 'publish', 'closed', 'closed', '', 'joyj', '', '', '2018-01-06 00:27:49', '2018-01-06 00:27:49', '', 0, 'http://braican-api.ups.dock//?post_type=project&#038;p=244', 8, 'project', '', 0),
