(254, 2, '2017-12-09 22:53:24', '2017-12-09 22:53:24', 'Hey, you make cool stuff.\n\nSo maybe you should know that I\'ve got 7+ years building and designing for the web and have helped some really great people build some really cool stuff.\n\nMaybe you should also know that I\'m terrible at making beer, but that doesn\'t stop me from trying. Seriously, let me know if you <a href="http://breakbrewing.com/" target="_blank" rel="noopener">want some</a>.\n\nI\'m currently a senior developer at Tank Design where I\'ve built some of those aforementioned cool things for the similarly aforementioned cool clients. I also take on my own clients.\n\nSo get in touch, and let\'s see where we can take your ideas.', 'Home', '', 'inherit', 'closed', 'closed', '', '8-autosave-v1', '', '', '2017-12-09 22:53:24', '2017-12-09 22:53:24', '', 8, 'http://braican-api.ups.dock//8-autosave-v1/', 0, 'revision', '', 0),
(255, 2, '2016-03-30 13:57:06', '2016-03-30 13:57:06', '<h1>you want someone who enhances your brand.</h1>\r\nWith over 5 years of experience working for branding agencies, non-profits, and one of the best known news outlets in the nation, I can do just that. When I\'m not working as a senior developer for Tank Design in Cambridge, I\'m working on new ways to solve problems, yelling at the Red Sox to play better, eating good food, and trying to make beer.', 'Home', '', 'inherit', 'closed', 'closed', '', '8-revision-v1', '', '', '2016-03-30 13:57:06', '2016-03-30 13:57:06', '', 8, 'http://braican-api.ups.dock//8-revision-v1/', 0, 'revision', '', 0),
(256, 2, '2016-03-30 14:01:12', '2016-03-30 14:01:12', '<h1>you want someone who can understand and enhance your brand.</h1>\r\nWith over 5 years of experience working for branding agencies, non-profits, and one of the most well-known news outlets in the nation, I can do just that. At the moment, when I\'m not working as a senior developer for Tank Design in Cambridge, I\'m yelling at the Red Sox to play better, training for a half marathon, and trying to make beer.', 'Home', '', 'inherit', 'closed', 'closed', '', '8-revision-v1', '', '', '2016-03-30 14:01:12', '2016-03-30 14:01:12', '', 8, 'http://braican-api.ups.dock//8-revision-v1/', 0, 'revision', '', 0),
