(267, 2, '2017-12-08 23:02:48', '2017-12-08 23:02:48', 'Look, I wish I was funny enough to make this super interesting.\r\n\r\nInstead, I\'ll just say that I\'ve got 7+ years building and designing for the web, I\'ve built some really cool stuff for some really cool people, I\'m pretty terrible at making beer, and that four things to list out on a portfolio site may be a bit much.\r\n\r\nI\'m currently a senior developer at Tank Design where I\'ve built some of those aforementioned cool things for the similarly aforementioned cool clients.', 'Home', '', 'inherit', 'closed', 'closed', '', '8-revision-v1', '', '', '2017-12-08 23:02:48', '2017-12-08 23:02:48', '', 8, 'http://braican-api.ups.dock//8-revision-v1/', 0, 'revision', '', 0),
