(270, 2, '2017-12-09 00:02:56', '2017-12-09 00:02:56', 'Look, I wish I was funny enough to make this super interesting.\r\n\r\nInstead, I\'ll just say that I\'ve got 7+ years building and designing for the web, I\'ve built some really cool stuff for some really cool people, I\'m pretty terrible at making beer, and I don\'t think that people should be limited to highlighting three things about themselves.\r\n\r\nI\'m currently a senior developer at Tank Design where I\'ve built some of those aforementioned cool things for the similarly aforementioned cool clients.', 'Home', '', 'inherit', 'closed', 'closed', '', '8-revision-v1', '', '', '2017-12-09 00:02:56', '2017-12-09 00:02:56', '', 8, 'http://braican-api.ups.dock//8-revision-v1/', 0, 'revision', '', 0),
(271, 2, '2017-12-09 00:04:09', '2017-12-09 00:04:09', 'Look, I wish I was funny enough to make this super interesting.\r\n\r\nInstead, I\'ll just say that I\'ve got 7+ years building and designing for the web, I\'ve built some really cool stuff for some really cool people, I\'m pretty terrible at making beer, and I don\'t think that people should be limited to highlighting three things about themselves.\r\n\r\nI\'m currently a senior developer at Tank Design where I\'ve built some of those aforementioned cool things for the similarly aforementioned cool clients. I also assume that you make some pretty cool stuff, and I\'d be excited to help you take it to the next level. So get in touch, and let\'s see where we can take your ideas.', 'Home', '', 'inherit', 'closed', 'closed', '', '8-revision-v1', '', '', '2017-12-09 00:04:09', '2017-12-09 00:04:09', '', 8, 'http://braican-api.ups.dock//8-revision-v1/', 0, 'revision', '', 0),
