(276, 2, '2018-01-03 04:34:51', '2018-01-03 04:34:51', 'I worked with JoyJ, a non-profit that helps to provide provisions and necessities to local homeless populations, to rebuild their website. We chose to use WordPress to provide a simple yet robust platform through which the group can spread their message through complete content control. The non-profit keeps a blog which they post to with relative frequency, and the site was designed as an informative one-page site to keep their information focused and clear.', 'JoyJ', '', 'inherit', 'closed', 'closed', '', '244-autosave-v1', '', '', '2018-01-03 04:34:51', '2018-01-03 04:34:51', '', 244, 'http://braican-api.ups.dock//244-autosave-v1/', 0, 'revision', '', 0),
