(281, 2, '2017-12-15 19:57:05', '2017-12-15 19:57:05', 'I teamed up with the fun team at Evil Genius Beer Company to redesign their brand site in WordPress to highlight their not-so-serious approach to beer and empower their team with complete content control. The rebuild highlights their original content and events that they host at their kick-ass taproom in Philadelphia and, of course, offers a detailed look at their ever-expanding beer list. For what it\'s worth, their #Adulting Guava IPA is something you should definitely try if you ever get the chance.', 'Evil Genius', '', 'publish', 'closed', 'closed', '', 'evil-genius', '', '', '2018-01-05 23:34:34', '2018-01-05 23:34:34', '', 0, 'http://braican-api.ups.dock//?post_type=project&#038;p=281', 2, 'project', '', 0),
