(315, 2, '2017-12-29 05:18:57', '2017-12-29 05:18:57', '<p>Ready to start your next great project? I\'ve started an message for you below. Just add your name and email and maybe some info on what you\'re looking to do, and I\'ll get in touch as soon as I can.</p>\r\n\r\n<div class="content__main footer__contact">\r\n<p>Hey Nick, <br>My name is [text* sender_name akismet:author class:contact__input placeholder "Xander Bogaerts"] and you can reach me at [email* sender_email akismet:author_email class:contact__input placeholder "xman@gmail.com"]. I\'m looking for somebody to help me out&nbsp;with:</p>\r\n[textarea sender_main class:contact__textarea rows:3 placeholder "I want to build the next Bitcoin. It\'s called Yamcoin, and we need a website."]\r\n<p><button type="submit" class="a-btn">Let\'s go</button></p>\r\n</div>\n1\n[New inquiry from braican.com] - From [sender_name]\n[sender_name] <wordpress@braican.com>\nnick.braica@gmail.com\nFrom: [sender_name] <[sender_email]>\r\n\r\n[sender_main]\r\n\r\n-- \r\nThis e-mail was sent from a contact form on braican.com\r\n(http://braican-api.ups.dock/)\n\n\n\n\n\nNick Braica // web developer "[your-subject]"\nNick Braica // web developer <wordpress@braican.local>\n[your-email]\nMessage Body:\r\n[your-message]\r\n\r\n-- \r\nThis e-mail was sent from a contact form on Nick Braica // web developer (http://braican-api.ups.dock/)\nReply-To: nick.braica@gmail.com\n\n\n\nThanks for getting in touch. Keep an eye out for a response.\nThere was an error trying to send your message. Please try again later.\nYou\'ve got to give me something here! Please make sure you\'re including your name and email so I can get in touch.\nThere was an error trying to send your message. Please try again later.\nYou must accept the terms and conditions before sending your message.\nThe field is required.\nThe field is too long.\nThe field is too short.\nThe date format is incorrect.\nThe date is before the earliest one allowed.\nThe date is after the latest one allowed.\nThere was an unknown error uploading the file.\nYou are not allowed to upload files of this type.\nThe file is too big.\nThere was an error uploading the file.\nThe number format is invalid.\nThe number is smaller than the minimum allowed.\nThe number is larger than the maximum allowed.\nThe answer to the quiz is incorrect.\nYour entered code is incorrect.\nThe e-mail address entered is invalid.\nThe URL is invalid.\nThe telephone number is invalid.\nflamingo_email: "[sender_email]"\r\nflamingo_name: "[sender_name]"\r\nflamingo_subject: "Submission from [sender_email]"', 'Main contact form', '', 'publish', 'closed', 'closed', '', 'contact-form-1', '', '', '2018-06-15 20:35:12', '2018-06-15 20:35:12', '', 0, 'http://braican-api.ups.dock//?post_type=wpcf7_contact_form&#038;p=315', 0, 'wpcf7_contact_form', '', 0),
