(327, 2, '2018-01-03 04:23:05', '2018-01-03 04:23:05', 'I helped to create and found Building Conversation, an augmented reality architectural visualization company serving both the urban public process and private design and development firms. The project started as an interdisciplinary capstone project at Northeastern University with a team that consisted of myself and six other seniors in the Interactive Media program. Working with input from Sasaki Associates in Watertown, Massachusetts, our team developed an iPad app that allows the user to see a proposed building project in real time and space. The app also serves as a discussion platform to engage the public directly with the stakeholders in the project, namely the arichtects, project managers and architects of new building proposals. The project received the 2013 RISE Interdisciplinary award at Northeastern University\'s Research, Innovation, and Scholarship Expo.\n\nIn addition to being a member of the core team and helping out with some of the more intense iOS development, my primary task was to develop a complimentary website for the app that further engages the user. Part of this included interfacing directly with the data received from the app, as well as providing a more robust forum for the community.', 'Building Conversation', '', 'inherit', 'closed', 'closed', '', '35-autosave-v1', '', '', '2018-01-03 04:23:05', '2018-01-03 04:23:05', '', 35, 'http://braican-api.ups.dock//35-autosave-v1/', 0, 'revision', '', 0),
(328, 2, '2018-01-03 04:26:42', '2018-01-03 04:26:42', 'I teamed up with the guys at Evil Genius Beer Company to redesign their brand site in WordPress to highlight their not-so-serious approach to beer and empower their team with complete content control. The rebuild highlights their original content and events that they host at their kickass taproom in Philadelphia, and of course offers a detailed look at their ever expanding list of beers. For what it\'s worth, their #Adulting Guava IPA is something you should definitely try if you ever get the chance.', 'Evil Genius', '', 'inherit', 'closed', 'closed', '', '281-autosave-v1', '', '', '2018-01-03 04:26:42', '2018-01-03 04:26:42', '', 281, 'http://braican-api.ups.dock//281-autosave-v1/', 0, 'revision', '', 0),
