(960, 0, '2018-04-04 03:38:33', '2018-04-04 03:38:33', 'Yasser El Hamoumi\ny.elhamoumi@gmail.com\nI am looking for a developer to put together a sleek website which can register members (ideally through Gmail or Facebook). Then once registered, members can login and respond to polling questions. Here is a brief description of the project I’m seeking to develop:\r\n•	Consensus is a community centric platform which aims to facilitate civic engagement and participation by aggregating the sentiment of thousands of citizens and allowing them to communicate their collective preferences to local officials on an on-demand basis\r\n•	Through an online/mobile platform, Consensus will periodically prompt its users to participate in a short poll regarding important and topical local issues e.g. Upcoming developments projects\r\n•	The polls will include a condensed summary of the issue and the high-level impacts. Following a fixed polling period, the results will be posted and will serve as a record of the public\'s consensus', 'Submission from y.elhamoumi@gmail.com', '', 'publish', 'closed', 'closed', '', 'submission-from-y-elhamoumigmail-com', '', '', '2018-04-04 03:38:33', '2018-04-04 03:38:33', '', 0, 'http://braican-api.ups.dock//?post_type=flamingo_inbound&p=960', 0, 'flamingo_inbound', '', 0),
